B.Mr=new A.cg('I and Jonathan organized and managed the booth for Master of Immersive Media Technologies(MIMT) over the four day course of the festival from 21st Oct to 24th Oct. The images of 3D models were printed and showcased on the black boards, pre-recorded videos of VR experiences made by students were displayed on the display screen and we had a PCVR(HP Reverb G2) and a Standalone(Quest 3) headset ready to show and explain the capabilities and current possibilities with virtual and mixed reality.\n\nFor this purpose we showcased we showcased the 3D assets and Virtual Reality experiences made by current and past MIMT students, artistic interactive worlds in VR chat, beautiful animations in theater elsewhere, and mixed reality with hand tracking using Demeo(a DnD style board game). It was a really great experience hosting this booth and seeing people amazed at VR and MR. Especially anyone who tried Mixed Reality with hand tracking was completely blown away. People who had free time stayed to experience all that we had to offer, with all the student projects, VR Chat painting and mind bending worlds and mixed reality games.\n\n As for my work that was put for exhibition included 4 of my 3d assets, "Alien Gun", "Dungeon Entrance", "Healing Altar", and "The Beholder" and also the "Dungeon Entrance scene" where people could walk around in a eerie dungeon with demonic chanting in the background where they could pick up the Alien Gun and try it.',null)
